        </div>
        <div className="row me-1">
          <div className="col-md-8">
            <Article />
            <Article />
            <Article />
          </div>
          <div className="col-md-4 ">
            <FicheEmployer />
          </div>
        </div>
      </div>*/}

      <div className=" col  mb-2  ">
        <div className="mx-3">
          <div className="row flex-grow-1">
            <ChartOne />
            <ChartTwo />
            <ClientCarousel />
          </div>
          <div className="row flex-grow-1">
            <PubArtHttp />
         
            <Action />
          </div>
        </div>
      </div> 
    </div>
  );
}
export default Body;
